de; return $this; } public function getChatConversationId(): string { return $this->chatConversationId; } public function setChatConversationId(string $chatConversationId): self { $this->chatConversationId = $chatConversationId; return $this; } public function getChatTopicId(): string { return $this->chatTopicId; } public function setChatTopicId(string $chatTopicId): self { $this->chatTopicId = $chatTopicId; return $this; } public function getInstruction(): string { return $this->instruction; } public function setInstruction(string $instruction): self { $this->instruction = $instruction; return $this; } public function getSandboxId(): string { return $this->sandboxId; } public function setSandboxId(string $sandboxId): self { $this->sandboxId = $sandboxId; return $this; } public function getSuperDelightfulTaskId(): string { return $this->superDelightfulTaskId; } public function setSuperDelightfulTaskId(string $superDelightfulTaskId): self { $this->superDelightfulTaskId = $superDelightfulTaskId; return $this; } /** * ImplementationJsonSerializableInterface.*/ public function jsonSerialize(): array { return [ 'agent_user_id' => $this->agentUserId, 'user_id' => $this->userId, 'organization_code' => $this->organizationCode, 'chat_conversation_id' => $this->chatConversationId, 'chat_topic_id' => $this->chatTopicId, 'instruction' => $this->instruction, 'sandbox_id' => $this->sandboxId, 'super_magic_task_id' => $this->superDelightfulTaskId, ]; } } 